import { useEffect, useState } from "react";
import {GeoJSON} from 'react-leaflet'
//import geoJson from './json/world_-1.json';
export default function MapPoly(props){
    const [dataJson,setDataJson] = useState();
    const [isSet,setIsSet] = useState(false)
    let data = require('./json/world_'+props.finalNumber +'.json');


      useEffect(()=>{
        setDataJson(data);
        setIsSet(true);
      },[])

    if(isSet){
        return(
            <>
            <GeoJSON key='my-geojson' data={dataJson} />
            </>
        )
    }
}
